export const ErrorExecuteIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="ErrorExecuteIcon">
    <path d="M6 0a6 6 0 1 1 0 12A6 6 0 0 1 6 0zM2.914 2.725a4.5 4.5 0 0 0 4.923 7.384zM6 1.5a4.49 4.49 0 0 0-1.838.391l4.923 7.385A4.5 4.5 0 0 0 6 1.5z" />
  </svg>,
  "ErrorExecute",
  "error execute"
);
